def is_respectable_eight_point_set(points):
    if len(points) == 8:
        return 'ugly'
    x_coords = set()
    y_coords = set()
    x_to_y = {}
    for (x, y) in points:
        x_coords.add(x)
        y_coords.add(y)
        if x in x_to_y:
            x_to_y[x].append(y)
        else:
            x_to_y[x] = [y]
    if len(x_coords) != 3 or len(y_coords) != 3:
        return 'ugly'
    sorted_x = sorted(x_coords)
    sorted_y = sorted(y_coords)
    for x in sorted_x:
        x_to_y[x].sort()
    if x_to_y[sorted_x[0]] != sorted_y or x_to_y[sorted_x[2]] != sorted_y:
        return 'ugly'
    if sorted_y[1] in x_to_y[sorted_x[1]]:
        return 'ugly'
    if sorted_y[0] in x_to_y[sorted_x[1]] and sorted_y[2] in x_to_y[sorted_x[1]]:
        x_to_y[sorted_x[1]].remove(sorted_y[0])
        x_to_y[sorted_x[1]].remove(sorted_y[2])
        if len(x_to_y[sorted_x[1]]) == 0:
            return 'respectable'
        else:
            return 'ugly'
    else:
        return 'ugly'

